globalFunctions.methods:
//Following global functions are created from Dialog Template 

function goNext(arg){botContext.setTriggerNextMessage(arg);} // navigate to an interaction
function getUserMessage(){return botContext.getCurrentUserMessage();} // return what user just said
function getIntent(){return botContext.getDialogStarterIntent();} // return the name of the matched dialog intent
function setBotVar(arg,val){botContext.setBotVariable(arg, val, true, false);} // set a variable (session duration)
function getBotVar(arg){return botContext.getBotVariable(arg);} // return a variable's value
function getWebVar(arg){return botContext.getWebViewVariable(arg);} // return a web variable's value (set by a web view api)
function getEnvVar(arg){return botContext.getEnvVariable(arg);} // return an environment variable's value
function debugMsg(arg){botContext.printDebugMessage(arg);} // print a debug message in the bot logs
function debugVar(arg){botContext.printDebugMessage(arg + ': ' + getBotVar(arg));} // print a variable name and its value to the bot logs
function printVar(arg){botContext.sendMessage(arg + ": " + getBotVar(arg));}  // print out a variable value in the conversation
function logEvent(event_name) {botContext.logCustomEvent('', event_name, '');}  // log a custom event for a particular event name
function logEventAdv(user_message, event_name, event_details) {botContext.logCustomEvent(user_message, event_name, event_details);}  // log a detailed custom event

function sendMsg(arg){botContext.sendMessage(arg);} // sends single text message
function sendMsgArr(arr){botContext.sendMessages(arr);} // takes an array and sends multiple text messages

function setDelay(arg){botContext.setMessageDelay(arg);} // when called from PreProcess code will add delay to the interaction (in miliseconds)
function goDefault(){goNext("platform.default");} // generally used in Process User Response script as "else" to send user response to the NLU

// SET A CONVERSATION LEVEL CONTEXT VARIABLE
function setContextConv(key, value) {
  var success = botContext.setContextDataForConversation(getBotVar('contextNameSpace'), key, value);
  if (success) {
    debugMsg("SETTING Context Data: Key: "+key+ "; Value: "+value);
  }else{
    debugMsg("FAILED to Set Context Data: Key: "+key+ "; Value: "+value);
  }
}
// GET A CONVERSATION LEVEL CONTEXT VARIABLE
function getContextConv(key) {
  var success = botContext.getContextDataForConversation(getBotVar('contextNameSpace'), key);
  if (success) {
    debugMsg("GETTING Context Data: Key: "+key+ "; Value: "+success);
    return success;
  }else{
    debugMsg("FAILED to Get Context Data: Key: "+key);
  }
}

/* trail('<interaction name>'): 
sets a 'breacrumb' variable containing name of current interaction; example: - trail('button_question123');
Increments an 'error counter' for each unmatched phrase on current interaction, and reset upon moving to next interaction.
Adds each interaction to an array of previous interactions, which can then be used in the function 'previous();'
NOTE: Trail() function must be added to every 'question' interaction
*/
//trail = function(val) { var e = getBotVar('intArr'); if (e == 'null' || e == null) { e = []; } else { e = e.split(',');} e.push(val); setBotVar('intArr', e.toString()); txt(e.toString()); var count = Number(getBotVar('errorCounter')); var breadcrumb = getBotVar('breadcrumb'); if (breadcrumb != val) {count = 0;} setBotVar('errorCounter', count); setBotVar('breadcrumb', val); };
function trail(val) { 
  var e = getBotVar('intArr'); 
  if (e == 'null' || e == null || e.length === 0) { 
    e = []; 
  } else { 
    e = e.split(',');
  } 
  e.push(val); 
  setBotVar('intArr', e.toString()); 
  var count = Number(getBotVar('errorCounter')); 
  var breadcrumb = getBotVar('breadcrumb'); 
  if (breadcrumb != val) {
    count = 0;
  } 
  setBotVar('errorCounter', count); 
  setBotVar('breadcrumb', val); 
}
/* previous 
Used in conjunction with the 'trail()' function.
Goes to previous interaction in the 'interactionArray' and pops the last interaction name.
*/
function previous(){
  var e = getBotVar('intArr').split(",");
  if(e.length === 1){
    debugMsg('You are already back to the start');
  }
  e.pop();  
  setBotVar('intArr', e);
  goNext(e.pop());
}


